prompt:
You are an expert in JSON webpage creation. Your task is to design a webpage based on the following requirements: {input}. 

Please ensure the JSON output includes the following elements:
1. A clear and descriptive title for the webpage.
2. A structured layout with sections relevant to the task, such as headers, main content, and footers.
3. Use appropriate JSON keys to represent different components like images, text, links, and forms.
4. Include any interactive elements such as buttons or forms with necessary attributes like action URLs and method types.
5. Ensure the JSON is well-formatted and follows a logical hierarchy.

For example, if the task involves creating a webpage for an event, include sections for event details, schedule, and registration. If the task is for an e-commerce page, include product listings, descriptions, and a shopping cart feature.

Remember to maintain consistency in naming conventions and structure throughout the JSON.

Here are some examples to guide you:

Example 1:
- Task: Create a webpage for a music concert with a lineup, ticket purchase button, and event details.
- JSON Output:
  ```json
  {
    "title": "Summer Beats Music Concert 2024",
    "layout": {
      "header": {
        "logo": {
          "src": "https://example.com/images/summer-beats-logo.png",
          "alt": "Summer Beats Music Concert Logo"
        },
        "navigation": [
          {"label": "Home", "href": "/"},
          {"label": "Lineup", "href": "#lineup"},
          {"label": "Tickets", "href": "#tickets"},
          {"label": "Location", "href": "#location"}
        ]
      },
      "main": {
        "marquee": {
          "type": "scrolling",
          "text": "🔥 Early Bird Tickets Available Now! | 🎤 Featuring Top Artists | 🎉 Food Trucks & Merch Stalls | 🕒 Gates Open at 4PM | 🌟 Don’t Miss the Summer’s Biggest Music Event!",
          "speed": "medium"
        },
        "heroSection": {
          "backgroundImage": "https://example.com/images/concert-hero.jpg",
          "headline": "Experience the Ultimate Summer Beats!",
          "subheadline": "Join us for an unforgettable night of music, fun, and memories.",
          "ctaButton": {
            "text": "Buy Tickets",
            "href": "#tickets",
            "style": "primary"
          }
        },
        "sections": [
          {
            "id": "lineup",
            "type": "artistsLineup",
            "title": "Performing Artists Lineup",
            "artists": [
              {
                "name": "DJ Nova",
                "image": "https://example.com/images/artists/dj-nova.jpg",
                "genre": "Electronic Dance",
                "performanceTime": "6:00 PM"
              },
              {
                "name": "The Sunsets",
                "image": "https://example.com/images/artists/the-sunsets.jpg",
                "genre": "Indie Rock",
                "performanceTime": "7:30 PM"
              }
            ]
          },
          {
            "id": "tickets",
            "type": "ticketPurchase",
            "title": "Get Your Tickets",
            "description": "Secure your spot at the Summer Beats Music Concert. Limited tickets available!",
            "ticketOptions": [
              {
                "type": "General Admission",
                "price": "$49",
                "benefits": ["Access to all performances", "Free festival wristband"]
              },
              {
                "type": "VIP Pass",
                "price": "$99",
                "benefits": ["All General Admission perks", "VIP lounge access", "Meet & Greet with artists"]
              }
            ],
            "purchaseButton": {
              "type": "form",
              "action": "https://tickets.example.com/purchase",
              "method": "POST",
              "fields": [
                {
                  "label": "Ticket Type",
                  "name": "ticket_type",
                  "type": "select",
                  "options": ["General Admission", "VIP Pass"],
                  "required": true
                },
                {
                  "label": "Quantity",
                  "name": "quantity",
                  "type": "number",
                  "min": 1,
                  "max": 10,
                  "required": true
                },
                {
                  "label": "Email Address",
                  "name": "email",
                  "type": "email",
                  "required": true
                }
              ],
              "submitButton": {
                "text": "Purchase Tickets",
                "style": "primary"
              }
            }
          }
        ]
      },
      "footer": {
        "socialLinks": [
          {"platform": "Instagram", "href": "https://instagram.com/summerbeats"},
          {"platform": "Facebook", "href": "https://facebook.com/summerbeats"},
          {"platform": "Twitter", "href": "https://twitter.com/summerbeats"}
        ],
        "contactInfo": {
          "email": "info@summerbeats.com",
          "phone": "+1 (555) 123-4567"
        },
        "copyright": "© 2024 Summer Beats Music Concert. All rights reserved."
      }
    }
  }
  ```

