          },
          {
            "id": "lineup",
            "type": "section",
            "header": {
              "type": "h2",
              "text": "Artist Lineup & Performance Schedule"
            },
            "content": [
              {
                "type": "table",
                "columns": ["Artist", "Stage", "Date", "Time"],
                "rows": [
                  ["The Sunbeams", "Main Stage", "July 19", "7:00 PM - 8:30 PM"],
                  ["River Groove", "Lake Stage", "July 19", "5:00 PM - 6:30 PM"]
                ]
              }
            ]
          }
        ]
      },
      "footer": {
        "contactInfo": {
          "address": "Sunnyville Central Park, 123 Festival Ave, Sunnyville",
          "email": "info@sunnyvillefestival.com",
          "phone": "(555) 123-4567"
        },
        "socialLinks": [
          {"platform": "Facebook", "url": "https://facebook.com/sunnyvillefestival"},
          {"platform": "Instagram", "url": "https://instagram.com/sunnyvillefestival"},
          {"platform": "Twitter", "url": "https://twitter.com/sunnyfest"}
        ],
        "copyright": "© 2024 Sunnyville Summer Festival. All rights reserved."
      }
    }
  }
  ```

